import React, { useState, useEffect } from "react";
import PocketBase from "pocketbase";
import "./VolumeConverter.css";

const pb = new PocketBase("http://127.0.0.1:8090");
pb.autoCancellation(false);

const Superscript = ({ value }) => {
  if (!value || isNaN(value)) return "...";
  const [base, exponent] = Number(value).toExponential(2).split("e");
  return (
    <>
      {parseFloat(base).toFixed(2)}×10<sup>{exponent.replace("+", "")}</sup>
    </>
  );
};

const NormalFormat = (val) => {
  if (!val || isNaN(val)) return "...";
  if (val.toString().includes("e")) {
    const [base, exponent] = Number(val).toExponential(2).split("e");
    return (
      <>
        {parseFloat(base).toFixed(2)}×10<sup>{exponent.replace("+", "")}</sup>
      </>
    );
  }
  return Number(val).toLocaleString("en-US", { maximumFractionDigits: 6 });
};

const RealWorldBox = ({ selected, setSelected, items, volumeM3 }) => {
  const result =
    selected && volumeM3 && selected.scientific_value
      ? volumeM3 / selected.scientific_value
      : null;

  const sortedItems = [...items].sort(
    (a, b) => a.scientific_value - b.scientific_value
  );

  return (
    <div className="bg-white shadow border rounded p-4 flex flex-col gap-3">
      <div className="text-xl font-bold text-blue-600 text-center">
        {result ? <Superscript value={result} /> : "..."}
      </div>

      <select
        value={selected?.id || ""}
        onChange={(e) => {
          const item = items.find((i) => i.id === e.target.value);
          if (item) setSelected(item);
        }}
        className="border p-2 rounded w-full text-sm"
      >
        {sortedItems.map((item) => (
          <option key={item.id} value={item.id}>
            {item.name}
          </option>
        ))}
      </select>

      {selected && (
        <div className="text-sm text-gray-700 bg-gray-50 rounded p-2 border">
          <div className="font-semibold text-center">{selected.name}</div>
          <div className="flex justify-between text-xs mt-1">
            <span className="text-blue-600">
              <Superscript value={selected.scientific_value} />
            </span>
            <span className="text-right">
              {NormalFormat(selected.approx_value)}{" "}
              {selected.expand?.unit?.symbol || ""}
            </span>
          </div>
          {selected.notes && (
            <div className="text-center text-gray-500 italic mt-2">
              {selected.notes}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default function VolumeConverter() {
  const [units, setUnits] = useState([]);
  const [realItems, setRealItems] = useState([]);
  const [categoryId, setCategoryId] = useState("");
  const [inputValue, setInputValue] = useState("");
  const [fromUnit, setFromUnit] = useState("");
  const [toUnit1, setToUnit1] = useState("");
  const [toUnit2, setToUnit2] = useState("");
  const [toUnit3, setToUnit3] = useState("");
  const [sci, setSci] = useState(false);
  const [real1, setReal1] = useState(null);
  const [real2, setReal2] = useState(null);
  const [real3, setReal3] = useState(null);

  useEffect(() => {
    const getCat = async () => {
      const res = await pb.collection("categories").getFullList();
      const volume = res.find((cat) => cat.name === "Volume");
      if (volume) setCategoryId(volume.id);
    };
    getCat();
  }, []);

  useEffect(() => {
    if (categoryId) {
      pb.collection("units")
        .getFullList({ filter: `category="${categoryId}"` })
        .then(setUnits)
        .catch(console.error);

      pb.collection("realworld_items")
        .getFullList({ filter: `category="${categoryId}"`, expand: "unit" })
        .then((records) => {
          setRealItems(records);
          setReal1(records[0]);
          setReal2(records[1]);
          setReal3(records[2]);
        })
        .catch(console.error);
    }
  }, [categoryId]);

  const convert = (toId) => {
    if (!inputValue || !fromUnit || !toId) return "";
    const from = units.find((u) => u.id === fromUnit);
    const to = units.find((u) => u.id === toId);
    if (!from || !to) return "";
    const result =
      (parseFloat(inputValue) * from.to_base_factor) / to.to_base_factor;
    return sci ? <Superscript value={result} /> : NormalFormat(result);
  };

  const getM3 = () => {
    const from = units.find((u) => u.id === fromUnit);
    return from && inputValue
      ? parseFloat(inputValue) * from.to_base_factor
      : null;
  };

  return (
    <div className="max-w-6xl mx-auto px-4 py-6 bg-white rounded-lg shadow">
      {/* Toggle */}
      <div className="flex justify-end mb-4">
        <div className="flex items-center border rounded bg-white shadow-sm">
          <button
            className={`px-4 py-1 rounded-l ${
              !sci ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setSci(false)}
          >
            Normal
          </button>
          <button
            className={`px-4 py-1 rounded-r ${
              sci ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setSci(true)}
          >
            Scientific
          </button>
        </div>
      </div>

      {/* Input + Conversions */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 items-start">
        <div className="space-y-4 mt-8">
          <h3 className="text-lg font-semibold text-center">From</h3>
          <input
            type="number"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            className="border p-2 rounded w-full"
            placeholder="Enter value"
          />
          <select
            value={fromUnit}
            onChange={(e) => setFromUnit(e.target.value)}
            className="border p-2 rounded w-full"
          >
            <option value="">-- Select unit --</option>
            {units.map((u) => (
              <option key={u.id} value={u.id}>
                {u.name} ({u.symbol})
              </option>
            ))}
          </select>
        </div>

        {/* Conversion Cards */}
        <div className="md:col-span-3 text-center -mt-6">
          <h2 className="text-2xl font-bold mb-4">Conversion</h2>
          <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
            {[toUnit1, toUnit2, toUnit3].map((unit, idx) => {
              const setter =
                idx === 0 ? setToUnit1 : idx === 1 ? setToUnit2 : setToUnit3;
              return (
                <div key={idx} className="border rounded p-4 bg-white shadow-sm">
                  <div className="text-xl font-bold text-blue-600 mb-2">
                    {convert(unit) || "..."}
                  </div>
                  <select
                    value={unit}
                    onChange={(e) => setter(e.target.value)}
                    className="border p-2 rounded w-full text-sm text-center"
                  >
                    <option value="">-- Convert To --</option>
                    {units.map((u) => (
                      <option key={u.id} value={u.id}>
                        {u.name} ({u.symbol}) – {convert(u.id)}
                      </option>
                    ))}
                  </select>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      {/* Real-World Cards */}
      {getM3() && (
        <div className="mt-10">
          <h3 className="text-lg font-semibold text-center mb-4">
            Compare To Real-World Volumes
          </h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <RealWorldBox
              selected={real1}
              setSelected={setReal1}
              items={realItems}
              volumeM3={getM3()}
            />
            <RealWorldBox
              selected={real2}
              setSelected={setReal2}
              items={realItems}
              volumeM3={getM3()}
            />
            <RealWorldBox
              selected={real3}
              setSelected={setReal3}
              items={realItems}
              volumeM3={getM3()}
            />
          </div>
        </div>
      )}
    </div>
  );
}
